function parseCSV(t){t=t.split("\n");const e=t[0].split(",");return t.slice(1).map(t=>{const s=t.split(","),n={};return e.forEach((t,e)=>{n[t.trim()]=s[e].trim()}),n})}fetch("https://docs.google.com/spreadsheets/d/e/2PACX-1vQlBwUvFAaHZIF_qkWGa-1chrXhLWOgH4W1wfk6obyT-U6e4p42J-LQDLuImQ8JT3OT35qqDVNPWOEW/pub?output=csv").then(t=>t.text()).then(t=>{t=parseCSV(t);console.log(t);const s=document.getElementById("flashcards-container");t.forEach(t=>{const e=document.createElement("div");e.classList.add("flashcard","question"),e.innerHTML=`
        <div class="text question">${t.question}</div>
        <div class="text answer">${t.answer}</div>
      `,e.addEventListener("click",()=>{e.classList.toggle("flipped")}),s.appendChild(e)})});